import React from 'react'
import styled from 'styled-components'
import Button from '@mui/material/Button'

export default function POcomponents({id},{isavailabel}) {
    return (
            <Container>
                <p>{id}</p>
                <input type="checkbox" checked={isavailabel}/>
            </Container>
    )
}

const Container = styled.div`
    display: flex;

`;
